import React from 'react'
import './ContentList.css'

function ContentList() {
  return (
    <div className="lst-card row">
      <div>
        {/* data의 번호 */}
        <span className="lst-num">{'번호 들어갈 자리'}</span>
        {/* data의 제목 */}
        <span className="lst-subject">{'제목 들어갈 자리'}</span>
      </div>
      {/* data의 작성일자 */}
      <div className="lst-data">{'작성일자 들어갈 자리'}</div>
    </div>
  )
}

export default ContentList
